class Header extends Component {
  render() {
    const { openModal } = this.props;

    return (
      <Container>
        <header>
          <img src={Logo} alt="GoRestaurant" />
          <nav>
            <div>

            </div>
          </nav>
        </header>

      </Container>
    )
  }
};

export default Header;
